import React from 'react';

function Projects() {
  return (
    <div className="p-8 max-w-6xl mx-auto">
      <h2 className="text-2xl font-bold mb-8 text-center">Projects</h2>
      <div className="grid gap-6 sm:grid-cols-2">
        <div className="p-4 border rounded shadow">
          <h3 className="font-semibold">Dish Craft</h3>
          <p className="text-sm">A social cooking platform using MERN stack</p>
          <a href="https://github.com/Dilhara2002" className="text-blue-500">GitHub</a>
        </div>
      </div>
    </div>
  );
}

export default Projects;
